import ThemeContext from '../../context/ThemeContext'
import {ContactUsContainer, ContactDescription} from './styledComponents'

const ContactUs = () => (
  <ThemeContext.Consumer>
    {value => {
      const {lightTheme} = value
      return (
        <ContactUsContainer>
          <ContactDescription
            lightTheme={lightTheme}
            size="20px"
            fontWeight="600"
          >
            CONTACT US
          </ContactDescription>
        </ContactUsContainer>
      )
    }}
  </ThemeContext.Consumer>
)

export default ContactUs
